const styles = theme => ({
    card: {
        minWidth: 275,
        maxWidth: '50%',
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
    header: {
        display: 'inline-block',
        justifyContent: 'space-between'
    }
});

export default styles
